import React from 'react';
import axios from 'axios';

//import PhotoEntry from './PhotoEntry';
//import entries from './data/photo-entries';
performSearch = query => {
  axios
    .get(
      `https://api.unsplash.com/search/photos/?page=1&per_page=10&query=${query}&client_id=fCrJtMDaRTz2HBjmaO9KSMrSiYFlYpPOmTCCaHa6ln0`
    )
    .then(data => {
      this.setState({ imgs: data.data.results });
    })
    .catch(err => {
      console.log('Error happened during fetching!', err);
    });
};

const AlbumMaker = props =>{
  const displayphotos = () => {
    return props.photos.map(photo =>{
      return <photo url={photo.url} />;
    });
  };

  return (
    <section>{displayphotos()}</section>
  )
};


export default AlbumMaker;
